import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <div>
        {allCountryScores.map((country, index) => (
          <div key={index}>
            <h1>HIGH SCORES:{country.name}</h1>
            <ul>
              {country.scores.map((element) => (
                <h2>element.n</h2>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
